import styled from "styled-components";
import '../App.css';

export const Container = styled.div`
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
  width: 100vw;
  height: 100vh;
  background-color: black;
`

export const HomeTitle = styled.div`
  color: white;
  font-family: "OpenSansMedium";
  font-size: 40px;
`
